      <Grid item xs={12} lg={5} md={5}>
      <Typography variant="h3" component="h3" gutterBottom m>
       Hello There 
      </Typography>
        <Typography variant="h4" gutterBottom>
       <p> I'm Rayan Ramirez, a self-taught JavaScript developer / Release Engineer <FcCommandLine size="2rem"/> </p>
      </Typography>
      </Grid>
   </Grid>
   </div>
    )
}

export default Hero
